import { FC } from 'react';
import './styles/component.css';

import Card from 'react-bootstrap/Card';

type eventType = {
    title: string,
    time: string[]
}

const calendarEvents = require("../data/calendarEvents.json");

function renderEvent(eventInfo: eventType) {
    return (
        <div className='info display-in-row-wrap calendar'>
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>{eventInfo.title}</Card.Title>
                    <Card.Text>
                        {eventInfo.time}
                    </Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
}

const Calendar: FC = () => {
    return calendarEvents.events.map((eventInfo: eventType) => {
        {renderEvent(eventInfo)}
    });
};

export default Calendar;
